import Taras from "../../resources/img/taras.png";

export const servicesImg = [
  {
    img: Olecksiy,
    name: "Олексій Дорошенко",
    id: 1,
  },
  {
    img: Teodora,
    name: "Теодора Левенко",
    id: 2,
  },
  {
    img: Jesica,
    name: "Джесіка Паркер",
    id: 3,
  },

  {
    img: Taras,
    name: "Тарас Балінській",
    id: 4, // Змінив id, щоб він був унікальним
  },
];
